                if (isNaN(+secs) || +secs < 1) {
                        return '';
                }
                var hours = Math.floor(secs / 3600),
                        divisor_for_minutes = secs % 3600,
                        minutes = Math.floor(divisor_for_minutes / 60),
                        divisor_for_seconds = divisor_for_minutes % 60,
                        seconds = Math.ceil(divisor_for_seconds),
                        time = [];
                if (hours) {
                        time.push(hours);
                }
